  modal_scripts() {


    // Get DOM Elements
    const modalBtn = document.querySelector('.together-btn');
    const modal = document.querySelector('.together-modal');
    const closeBtn = document.querySelector('.together-close');
    const emergencyBtn = document.querySelector('.together-btn-emergency');
    const friendsBtn = document.querySelector('.together-btn-friends');
    const contentHome = document.querySelector('.together-modal-content-home');
    const contentEmergency = document.querySelector('.together-modal-content-call-emergency')
    const contentFriends = document.querySelector('.together-modal-content-call-friends')
    const backBtn = document.querySelector('.together-back')
    const contentBackBtn = document.querySelector('.together-modal-content-back-btn')

    // Events
    modalBtn.addEventListener('click', openModal);
    closeBtn.addEventListener('click', closeModal);
    window.addEventListener('click', outsideClick);
    emergencyBtn.addEventListener('click', togetherEmergency);
    friendsBtn.addEventListener('click', togetherFriends);
    backBtn.addEventListener('click', openModal);


    // Open
    function openModal() {
      modal.style.display = 'block';
      contentHome.style.display = "block";
      contentEmergency.style.display = "none";
      contentFriends.style.display = "none";
      contentBackBtn.style.display = 'none';
    }

    // Close
    function closeModal() {
      modal.style.display = 'none';
    }

    // Close If Outside Click
    function outsideClick(e) {
      if (e.target == modal) {
        modal.style.display = 'none';
      }
    }

    function togetherEmergency() {
      contentHome.style.display = "none";
      contentEmergency.style.display = "block";
      contentBackBtn.style.display = 'block';

    }

    function togetherFriends() {
      contentHome.style.display = "none";
      contentFriends.style.display = "block";
      contentBackBtn.style.display = 'block';
    }

    openModal()


  }

  init = () => {
    document.querySelector('.together-btn').addEventListener('click', () => this.showModal());
  }


